def f_gold(board: List[List[int]]) -> int:
    def get(x):
        i, j = (x - 1) // n, (x - 1) % n
        if i & 1:
            j = n - 1 - j
        return n - 1 - i, j
    n = len(board)
    q = deque([1])
    vis = {1}
    ans = 0
