            curr = q.popleft()
            if curr == n * n:
                return ans
            for next in range(curr + 1, min(curr + 7, n * n + 1)):
                i, j = get(next)
                if board[i][j] != -1:
                    next = board[i][j]
                if next not in vis:
                    q.append(next)
                    vis.add(next)
        ans += 1
    return -1
